import x from '../../Assets/twitter.png'
import instagram from '../../Assets/ig.png'
import logo from '../../Assets/footer-mobile.png'

function Footer(){
    return(
        <footer class="footer ">
            <div class="container py-5 mx-md-5 ">
                <div class="row mx-md-5 mx-5">
                   
                </div>
            </div>
        </footer>
    )
}

export default Footer;
